import React from "react";

function Login() {
  return (
    <div className="register">
      <h1 className="text-white text-center text-3xl m-8">Login</h1>
      <form>
        <div className="grid grid-cols-1 gap-5 my-16 mx-12">
          <input type="email" placeholder="E-mail" />
          <input type="password" placeholder="password" />
          <input type="submit" className="my-20" value="login" />
          <input className="google_auth mx-4 text-xl" value="Login with Google"/>
        </div>
      </form>
    </div>
  );
}

export default Login;
